/*Table structure for table `tbl_payable` */

DROP TABLE IF EXISTS `tbl_payable`;

CREATE TABLE `tbl_payable` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `renters_id` int(4) DEFAULT NULL,
  `costume_id` int(4) DEFAULT NULL,
  `payable` int(4) DEFAULT NULL,
  `penalty` int(4) DEFAULT NULL,
  `days_delay` int(4) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `renters_id` (`renters_id`),
  CONSTRAINT `tbl_payable_ibfk_1` FOREIGN KEY (`renters_id`) REFERENCES `tbl_renter` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_payable` */

/*Table structure for table `tbl_rented_costumes` */

DROP TABLE IF EXISTS `tbl_rented_costumes`;

CREATE TABLE `tbl_rented_costumes` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `renters_id` int(4) DEFAULT NULL,
